column8:
本物のカーボンを採用しながら由にカットの出来き、曲面にも貼れるマジカルカーボン。リアルカーボンならではの質感は他製品を圧倒します。ホイールキャップエンブレムにあわせてカット済みで貼り付けるだけで施工できます。<br><br>ハセ･プロ独自の特殊加工を施している為カット面が毛羽立たず 、カーボン繊維に沿って伸ばす事が出きるのである程度の曲面等に貼り付ける事が可能でキレイな仕上がりが可能となります。また、対候性にも優れており、耐候５年、ヒートサイクル℃１３０度からー３０度を５回転させて劣化や剥がれ等のテストにも合格してます。<br><br>■カラー：マジョーラアンドロメダ（１枚目の写真は見本です）  ※納期：約1週間～10日 ※マジカルカーボンは特許番号3785244号取得した高品質カーボンシートです。類似品・粗悪品にご注意ください。<br><br><br>対応車種： マツダ　アテンザセダン　 GJEFP/GJ2FP　 （2012/11～)<br><br>グッズ・アクセサリー | グッズアクセサリーその他<br>マツダ | アテンザセダン | GJ系<tr><td colspan="2">
